INSERT INTO `couch_data_text` (`page_id`, `field_id`, `value`, `search_value`) VALUES
(1, 1, '<h2>Restaurant L&rsquo;estragon</h2>\r\n\r\n<h3 class=\"menucard__tagline\">En intim og im&oslash;dekommende restaurant</h3>\r\n\r\n<p>Vores vision er at skabe sanselige oplevelser ud fra lokale r&aring;varer i s&aelig;son, hvor det gr&oslash;nne f&aring;r lov at fylde. Tilberedning og godt h&aring;ndv&aelig;rk giver stor kompleksitet og nyskabelse i vores menu.</p>\r\n\r\n<p>Vores fokus er at arbejde b&aelig;redygtigt. Menuerne bliver planlagt ud fra s&aelig;son, dyrkningsmetoder og dyrevelf&aelig;rd. Vi s&aelig;lger ikke flaskevand og vi sorterer vores affald.</p>\r\n\r\n<p>Vi forhandler vin fra sm&aring; vinb&oslash;nder med godt h&aring;ndv&aelig;rk og ingen spr&oslash;jtemidler.</p>\r\n\r\n<p>Vores dr&oslash;m er at skabe mindev&aelig;rdige oplevelser gennem omsorg, godt h&aring;ndv&aelig;rk, mod til fornyelse og ansvarlige valg.</p>\r\n', 'Restaurant L’estragon En intim og imødekommende restaurant Vores vision er at skabe sanselige oplevelser ud fra lokale råvarer i sæson, hvor det grønne får lov at fylde. Tilberedning og godt håndværk giver stor kompleksitet og nyskabelse i vores menu. Vores fokus er at arbejde bæredygtigt. Menuerne bliver planlagt ud fra sæson, dyrkningsmetoder og dyrevelfærd. Vi sælger ikke flaskevand og vi sorterer vores affald. Vi forhandler vin fra små vinbønder med godt håndværk og ingen sprøjtemidler. Vores drøm er at skabe mindeværdige oplevelser gennem omsorg, godt håndværk, mod til fornyelse og ansvarlige valg.'),
(1, 2, '<h3>Maj-menu</h3>\r\n\r\n<h4>Start aftenen med bobler og snacks 115 kr.</h4>\r\n\r\n<h4>Menu Complete</h4>\r\n\r\n<p>Kartoffel-terrin, asparges, skalottel&oslash;g &amp; peberrod Sk&aelig;rising, stenbiderrogn, hjertesalat &amp; urter fra MolsTorsk, gule beder, peberfrugt samt rosmarin sauceRabarber, k&aelig;rnem&aelig;lk, estragon &amp; macadamian&oslash;dder</p>\r\n\r\n<p>350 kr.</p>\r\n\r\n<h4>Menu Grande</h4>\r\n\r\n<p>Kartoffel-terrin, asparges, skalottel&oslash;g &amp; peberrod Sk&aelig;rising, stenbiderrogn, hjertesalat &amp; urter fra mols Torsk, gule beder, peberfrugt samt rosmarin sauceFrikass&eacute; med dansk lam, ramsl&oslash;g, knoldselleri &amp; r&oslash;gRabarber, k&aelig;rnem&aelig;lk, estragon &amp; macadamian&oslash;dder</p>\r\n\r\n<p>475 kr.</p>\r\n\r\n<h4>Hele pakken &ndash; kr. 1100 kr.</h4>\r\n\r\n<p>Bobler og snacks, 5 retter, 3 danske oste, vinmenu &agrave; 6 glas, kaffe og petits fours</p>\r\n\r\n<h4>Vinmenu</h4>\r\n\r\n<p>2 glas 175 kr. / 3 glas 250 kr. / 4 glas 325 kr. / 5 glas 400 kr. / 6 glas 450 kr.</p>\r\n\r\n<p>Oste med tilbeh&oslash;r og kn&aelig;kbr&oslash;d. 75 kr.</p>\r\n\r\n<p>Kaffe og hjemmelavede petits fours til 75 kr.</p>\r\n\r\n<h4>Menu Petite &ndash; fra tirsdag til torsdag &ndash; kr. 350 kr.</h4>\r\n\r\n<p>To retter efter kokkens valg med to glas vin</p>\r\n\r\n<p>Vi har diverse saft, sodavand, &oslash;l og avec &ndash; sp&oslash;rg tjeneren</p>\r\n\r\n<p>Om s&oslash;ndagen har vi kun &eacute;n menu: 5 retter og 3 glas vin til kr. 444 kr.</p>\r\n\r\n<p>Vi holder &aring;bent til frokost hver l&oslash;rdag kl. 12-15</p>\r\n\r\n<p>Vi har guldm&aelig;rket i &oslash;kologi.</p>\r\n', 'Maj-menu Start aftenen med bobler og snacks 115 kr. Menu Complete Kartoffel-terrin, asparges, skalotteløg &amp; peberrod Skærising, stenbiderrogn, hjertesalat &amp; urter fra MolsTorsk, gule beder, peberfrugt samt rosmarin sauceRabarber, kærnemælk, estragon &amp; macadamianødder 350 kr. Menu Grande Kartoffel-terrin, asparges, skalotteløg &amp; peberrod Skærising, stenbiderrogn, hjertesalat &amp; urter fra mols Torsk, gule beder, peberfrugt samt rosmarin sauceFrikassé med dansk lam, ramsløg, knoldselleri &amp; røgRabarber, kærnemælk, estragon &amp; macadamianødder 475 kr. Hele pakken – kr. 1100 kr. Bobler og snacks, 5 retter, 3 danske oste, vinmenu à 6 glas, kaffe og petits fours Vinmenu 2 glas 175 kr. / 3 glas 250 kr. / 4 glas 325 kr. / 5 glas 400 kr. / 6 glas 450 kr. Oste med tilbehør og knækbrød. 75 kr. Kaffe og hjemmelavede petits fours til 75 kr. Menu Petite – fra tirsdag til torsdag – kr. 350 kr. To retter efter kokkens valg med to glas vin Vi har diverse saft, sodavand, øl og avec – spørg tjeneren Om søndagen har vi kun én menu: 5 retter og 3 glas vin til kr. 444 kr. Vi holder åbent til frokost hver lørdag kl. 12-15 Vi har guldmærket i økologi.'),
(1, 3, '<h1>Fest og Selskaber</h1>\r\n\r\n<p>Vi &aring;bner rigtig gerne op for selskaber b&aring;de i dag- og aftentimerne. Restauranten danner en smuk ramme om selskaber p&aring; op til 28 personer.</p>\r\n\r\n<p>Vi tilbyder alt, rangerende fra hele pakken med tjenere, servering og k&oslash;kkenpersonale p&aring; lokalisationen, til sm&aring; fad-anretninger og selv-hent fra k&oslash;kkenet.</p>\r\n\r\n<p>Kontakt os for mere info, s&aring; strikker vi et selskab sammen til jer.</p>\r\n', 'Fest og Selskaber Vi åbner rigtig gerne op for selskaber både i dag- og aftentimerne. Restauranten danner en smuk ramme om selskaber på op til 28 personer. Vi tilbyder alt, rangerende fra hele pakken med tjenere, servering og køkkenpersonale på lokalisationen, til små fad-anretninger og selv-hent fra køkkenet. Kontakt os for mere info, så strikker vi et selskab sammen til jer.');

